// Solution 1:
const reorderLogFiles = (logs) => {
    let letterLogs = [];
    let digitLogs = [];

    for(let i=0; i<logs.length; i++) {
        if(isNaN(logs[i].split(' ')[1][0])) {
            letterLogs.push(logs[i]);
        } else {
            digitLogs.push(logs[i]);
        }
    }

    letterLogs.sort((logA, logB) => {
        const [identifierA, contentA] = logA.split(' ');
        const [identifierB, contentB] = logB.split(' ');

        return contentA > contentB? 1 : -1;
    });

    return [...letterLogs,...digitLogs];
};

console.log(reorderLogFiles(['c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'a', 'a', 'a', 'a', 'a', 'd', 'a'])) // ['a', 'a', 'a', 'a', 'a', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'd', 'a']
console.log(reorderLogFiles(['a', 'a', 'a', 'a', 'a', 'a', 'a', 'f', 'f', 'f', 'f', 'f', 'a', 'a', 'a', 'd', 'a'])) // ['a', 'a', 'a', 'a', 'a', 'a', 'a', 'a', 'a', 'f', 'f', 'f', 'f', 'f', 'd', 'a']
console.log(reorderLogFiles(['a', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'a', 'a', 'a', 'a', 'a', 'a', 'a', 'd'])) // ['a', 'a', 'a', 'a', 'a', 'a', 'a', 'a', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'd']
console.log(reorderLogFiles(['a', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'a', 'a', 'a', 'a', 'd'])) // ['a', 'a', 'a', 'a', 'a', 'a', 'a', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'f', 'd']
